import React from 'react';
import './Home.css';

import RainbowBox from './../components/RainbowBox';
import ColorChanger from './../components/ColorChanger';

export default function Home () {
  const [color, setColor] = React.useState('#ff0054');

  return (
    <div className="container">
      <ColorChanger initColor={color} changeColor={(color) => setColor(color)}></ColorChanger>
      <RainbowBox color={color}></RainbowBox>
    </div>
  )
}
